#include <bits/stdc++.h>using namespace std; #define int long long int#define all(x) x.begin(), x.end()const int N = 3e5 + 5;vector<int> divs[N];int n, dp[N]; void solve(){    cin >> n;    vector<int> a(n), fre(n + 5, 0);    for (int i = 1; i <= n; i++) dp[i] = 1e9;    for (auto& i : a) {        cin >> i;        fre[i] = 1;        dp[i] = 1;    }    for (int i = 1; i <= n; i++) {        for (auto x : divs[i]) if (fre[x] > 0) dp[i] = min(dp[i], 1 + dp[i / x]);    }    for (int i = 1; i <= n; i++) {        if (dp[i] == 1e9) cout << -1 << ' ';        else cout << dp[i] << ' ';    }    cout << '\n';} int32_t main(){    ios_base::sync_with_stdio(0);    cin.tie(0);    for (int i = 1; i < N; i++) {        for (int j = i; j < N; j += i) {            divs[j].push_back(i);        }    }    int t = 1;    cin >> t;    while (t--)        solve();    return 0;}